  false,\n\t\"url\": null,\n\t\"notes\": \"The primary purpose of this project was
  to develop a consistent and accurate surface elevation dataset derived from high-accuracy
  Light Detection and Ranging (LiDAR) technology for the USGS California Coastal LiDAR
  project area. The LiDAR data were processed to a bare-earth digital terrain model
  (DTM). Detailed breaklines and bare-earth DEMs were produced for the project area.
  Data was formatted according to tiles with each tile covering an area of 1500 m
  by 1500 m. A total of 712 tiles were produced for the project encompassing an area
  of approximately 610 sq. miles. NOAA's Office for Coastal Management posted the
  project as two separate projects based on original data projections.\",\n\t\"license_title\":
